import React from 'react'

import myratings from "./fetchMyRatingdata"; 

 function Myratings() {

    const MyRatings= myratings;



  return (
            <>
            <Container>
                <br />
                <h1>MyRatings</h1>
                <Row>
                    {MyRatings.map((product) => (
                        <Col key={product.id} sm={12} md={6} lg={4} xl={3}>
                            <Mylistsscreen product={product} /> {/* Pass product data as a prop */}
                        </Col>
                    ))}
                </Row>
            </Container>
            <Footer /> {/* Include Footer component here */}
        </>
  )
}


export default Myratings;
